import React from "react";
import { Button } from "semantic-ui-react";

const Counter = () => (
  <div textAlign="center" style={{ height: "100vh" }} horizontalAlign="middle">
    <Button.Group>
      <Button color="red">DECREMENT</Button>
      <Button>RESET</Button>
      <Button color="green">INCREMENT</Button>
    </Button.Group>
  </div>
);

export default Counter;
